// ====================
// Pando Server Handler
// ====================

type pandoServer struct {
	Pando
	interceptor      twirp.Interceptor
	hooks            *twirp.ServerHooks
	pathPrefix       string // prefix for routing
	jsonSkipDefaults bool   // do not include unpopulated fields (default values) in the response
}

// NewPandoServer builds a TwirpServer that can be used as an http.Handler to handle
// HTTP requests that are routed to the right method in the provided svc implementation.
// The opts are twirp.ServerOption modifiers, for example twirp.WithServerHooks(hooks).
func NewPandoServer(svc Pando, opts ...interface{}) TwirpServer {
	serverOpts := twirp.ServerOptions{}
	for _, opt := range opts {
		switch o := opt.(type) {
		case twirp.ServerOption:
			o(&serverOpts)
		case *twirp.ServerHooks: // backwards compatibility, allow to specify hooks as an argument
			twirp.WithServerHooks(o)(&serverOpts)
		case nil: // backwards compatibility, allow nil value for the argument
			continue
		default:
			panic(fmt.Sprintf("Invalid option type %T on NewPandoServer", o))
		}
	}

	return &pandoServer{
		Pando:            svc,
		pathPrefix:       serverOpts.PathPrefix(),
		interceptor:      twirp.ChainInterceptors(serverOpts.Interceptors...),
		hooks:            serverOpts.Hooks,
		jsonSkipDefaults: serverOpts.JSONSkipDefaults,
	}
}

// writeError writes an HTTP response with a valid Twirp error format, and triggers hooks.
// If err is not a twirp.Error, it will get wrapped with twirp.InternalErrorWith(err)
func (s *pandoServer) writeError(ctx context.Context, resp http.ResponseWriter, err error) {
	writeError(ctx, resp, err, s.hooks)
}

// PandoPathPrefix is a convenience constant that could used to identify URL paths.
// Should be used with caution, it only matches routes generated by Twirp Go clients,
// that add a "/twirp" prefix by default, and use CamelCase service and method names.
// More info: https://twitchtv.github.io/twirp/docs/routing.html
const PandoPathPrefix = "/twirp/fox.pando.service.Pando/"

func (s *pandoServer) ServeHTTP(resp http.ResponseWriter, req *http.Request) {
	ctx := req.Context()
	ctx = ctxsetters.WithPackageName(ctx, "fox.pando.service")
	ctx = ctxsetters.WithServiceName(ctx, "Pando")
	ctx = ctxsetters.WithResponseWriter(ctx, resp)

	var err error
	ctx, err = callRequestReceived(ctx, s.hooks)
	if err != nil {
		s.writeError(ctx, resp, err)
		return
	}

	if req.Method != "POST" {
		msg := fmt.Sprintf("unsupported method %q (only POST is allowed)", req.Method)
		s.writeError(ctx, resp, badRouteError(msg, req.Method, req.URL.Path))
		return
	}

	// Verify path format: [<prefix>]/<package>.<Service>/<Method>
	prefix, pkgService, method := parseTwirpPath(req.URL.Path)
	if pkgService != "fox.pando.service.Pando" {
		msg := fmt.Sprintf("no handler for path %q", req.URL.Path)
		s.writeError(ctx, resp, badRouteError(msg, req.Method, req.URL.Path))
		return
	}
	if prefix != s.pathPrefix {
		msg := fmt.Sprintf("invalid path prefix %q, expected %q, on path %q", prefix, s.pathPrefix, req.URL.Path)
		s.writeError(ctx, resp, badRouteError(msg, req.Method, req.URL.Path))
		return
	}

	switch method {
	case "FindAsset":
		s.serveFindAsset(ctx, resp, req)
		return
	case "ListAssets":
		s.serveListAssets(ctx, resp, req)
		return
	case "FindOracle":
		s.serveFindOracle(ctx, resp, req)
		return
	case "ListOracles":
		s.serveListOracles(ctx, resp, req)
		return
	case "ListCollaterals":
		s.serveListCollaterals(ctx, resp, req)
		return
	case "FindCollateral":
		s.serveFindCollateral(ctx, resp, req)
		return
	case "FindVault":
		s.serveFindVault(ctx, resp, req)
		return
	case "ListVaults":
		s.serveListVaults(ctx, resp, req)
		return
	case "ListMyVaults":
		s.serveListMyVaults(ctx, resp, req)
		return
	case "ListVaultEvents":
		s.serveListVaultEvents(ctx, resp, req)
		return
	case "FindFlip":
		s.serveFindFlip(ctx, resp, req)
		return
	case "ListFlips":
		s.serveListFlips(ctx, resp, req)
		return
	case "ListFlipEvents":
		s.serveListFlipEvents(ctx, resp, req)
		return
	case "FindTransaction":
		s.serveFindTransaction(ctx, resp, req)
		return
	case "ListTransactions":
		s.serveListTransactions(ctx, resp, req)
		return
	default:
		msg := fmt.Sprintf("no handler for path %q", req.URL.Path)
		s.writeError(ctx, resp, badRouteError(msg, req.Method, req.URL.Path))
		return
	}
}

